  \"A histological evaluation of livers from the fish resident to select reaches of
  the Illinois River\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:41:37.630996\",\n\t\"name\": \"a-histological-evaluation-of-livers-from-the-fish-resident-to-select-reaches-of-the-illino\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The following report is based on fifty
  livers taken from a variety of fish species resident to the Illinois River. Of the
  fifty fish and necropsied, livers designated as IL 43 through 50 were from frozen
  samples, however were unsuitable for the purpose of this report. The basis of histological
  examination of the livers was to see if there are any changes which would reflect
  altered habitats and thereby cause disease (infectious and non-infectious) among
  the resident fish, or if lesions were present which would reflect conditions that
  may pose a significant threat to human health. Since many toxins are found to exert
  effects at the organ and tissue liver before evidence of clinical disease is seen,
  this technology is useful as an indicator in most circumstances. Historically, histological
  evaluations have been used primarily to detect tumors in major organs. In this case
  it has been used to determine if both tumors or sublethal (subclinical) effects
  are present. The effects would be likely due to habitat conditions or contamination
  from anthropogenic source.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
